import React, { useState } from 'react';
import { Container, Row, Col, Card, Button, Offcanvas, ListGroup, Alert } from 'react-bootstrap';



const ProductsPage = () => {
    const pro = [
        {
            img: 'https://t3.ftcdn.net/jpg/04/19/13/34/240_F_419133411_3xqpBMGkMKBZMDCvb9Fv5UNiStX7bTqV.jpg',
            id: 1,
            name: "Dosa",
            price: 50,
            ratting: "✪" + 4.3

        }, {
            img: 'data:image/jpeg;base64,',
            id: 2,
            name: "Idhy",
            price: 12,
            ratting: "✪" + 4.3,

        }, {
            img: 'data:image/jpeg;base64,',
            id: 3,
            name: "CHAPPATHI ",
            price: 35,
            ratting: "✪" + 4.8,

        }, {
            img: 'data:image/jpeg;base64,',
            id: 4,
            name: "Mutton Briyani",
            price: 220,
            ratting: "✪" + 4.9,

        }, {
            img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQM_-VAFGr7BHcS7n2KC1zVJlz5pScFml-kfw&s',
            id: 5,
            name: "Chicken Briyani",
            price: 160,
            ratting: "✪" + 4.0,

        }, {
            img: 'data:image/jpeg;base64,',
            id: 6,
            name: "Egg Briyani",
            price: 110,
            ratting: "✪" + 4.1,

        }, {
            img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTcO9WjAFXEh3zH2KIdWTqF6Q0h0Rdd-4U2Nw&s',
            id: 7,
            name: 'Chicken Fried Rice',
            price: 199,
            ratting: "✪" + 4.9
        }, {
            img: 'data:image/jpeg;base64,',
            id: 8,
            name: 'Chicken Noodles',
            price: 199,
            ratting: "✪" + 4.8

        }, {
            img: 'data:image/jpeg;base64,',
            id: 9,
            name: 'Tandoori Chicken',
            price: 399,
            ratting: "✪" + 4.9
        }]
    const [cart, setCart] = useState([]);
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    const addToCart = (product) => {
        const existingItem =
            cart.find((item) => item.id === product.id);
        if (existingItem) {
            setCart(
                cart.map((item) =>
                    item.id === product.id ? { ...item, quantity: item.quantity + 1 } : item
                )
            );
        } else {
            setCart([...cart, { ...product, quantity: 1 }]);
        }
    };
    const incrementQuantity = (productId) => {
        setCart(
            cart.map((item) =>
                item.id === productId ? { ...item, quantity: item.quantity + 1 } : item
            )
        );
    };
    const decrementQuantity = (productId) => {
        setCart(
            cart.map((item) =>
                item.id === productId && item.quantity > 1
                    ? { ...item, quantity: item.quantity - 1 }
                    : item
            )
        );
    };
    const removeItem = (productId) => { setCart(cart.filter((item) => item.id !== productId)); };
    const calculateTotal = () => {
        return cart.reduce((total, item) => total + item.price * item.quantity, 0);
    };

    return (
        <Container>

            <Row>
                {pro.map((product) => (
                    <Col key={product.id} md={3} className="mb-4">
                        <Card>
                            <Card.Img variant="top" src={product.img} style={{ height: 300, width: 300 }} />
                            <Card.Body>
                                <Card.Title>{product.name}</Card.Title>
                                <Card.Text>{product.price}</Card.Text>
                                <Button variant="primary" onClick={() => addToCart(product)}>
                                    Add to Cart
                                </Button>
                            </Card.Body>
                        </Card>
                    </Col>
                ))}
            </Row>
            <Button variant="success" onClick={handleShow} className="mt-3">
                View Cart
            </Button>

            <Offcanvas show={show} onHide={handleClose} placement="end">
                <Offcanvas.Header closeButton>
                    <Offcanvas.Title>Shopping Cart</Offcanvas.Title>
                </Offcanvas.Header>
                <Offcanvas.Body>
                    {cart.length === 0 ? (
                        <p>Your cart is empty.</p>
                    ) : (
                        <ListGroup>
                            {cart.map((item, index) => (
                                <ListGroup.Item key={index} className="d-flex justify-content-between align-items-center">
                                    <Card style={{ width: '100%' }}>
                                        <Card.Body className="d-flex justify-content-between align-items-center">
                                            <div className='container-fluid'>

                                                <div className='row' >
                                                    <img src={item.img} alt="" height={100} width={100} />
                                                    <Card.Title>{item.name}</Card.Title>
                                                    <Card.Text>
                                                        ₹{item.price} X {item.quantity} = {item.price * item.quantity}
                                                    </Card.Text>
                                                </div>
                                                <div className='row'>
                                                    <div className='d-flex justify-content-around'>
                                                        <Button variant="outline-primary" size="sm" onClick={() => incrementQuantity(item.id)} className=" btn col-4">+</Button>
                                                        <Button variant="outline-secondary" size="sm" onClick={() => decrementQuantity(item.id)}
                                                            className='btn col-4'  >-</Button>
                                                        <Button variant="outline-secondary" size="sm" onClick={() => removeItem(item.id)}><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-trash" viewBox="0 0 16 16">
                                                            <path d="M5.5 5.5A.5.5 0 0 1 6 6v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5m2.5 0a.5.5 0 0 1 .5.5v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5m3 .5a.5.5 0 0 0-1 0v6a.5.5 0 0 0 1 0z" />
                                                            <path d="M14.5 3a1 1 0 0 1-1 1H13v9a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2V4h-.5a1 1 0 0 1-1-1V2a1 1 0 0 1 1-1H6a1 1 0 0 1 1-1h2a1 1 0 0 1 1 1h3.5a1 1 0 0 1 1 1zM4.118 4 4 4.059V13a1 1 0 0 0 1 1h6a1 1 0 0 0 1-1V4.059L11.882 4zM2.5 3h11V2h-11z" />
                                                        </svg></Button>
                                                    </div>
                                                </div>
                                            </div>
                                        </Card.Body>
                                    </Card>
                                </ListGroup.Item>
                            ))}
                        </ListGroup>
                    )}
                    <div className="mt-3">
                        <h5>Total: ₹{calculateTotal()}</h5>
                    </div>
                </Offcanvas.Body>
            </Offcanvas>
        </Container>
    );
};

export default ProductsPage;